import React, { useState } from 'react';
import './login_register.css';

const AuthForm = () => {
    const [isLogin, setIsLogin] = useState(true);
    const [formData, setFormData] = useState({
        email: '',
        password: '',
        firstName: '',
        lastName: '',
        age: '',
    });

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        if (isLogin) {
            // Ajouter logique de connexion ici
            console.log('Connexion avec:', formData);
        } else {
            // Ajouter logique d'inscription ici
            console.log('Inscription avec:', formData);
        }
    };

    return (
        <div className="auth-container">
            {isLogin ? (
                <div className="form-container login-form">
                    <h2>Connexion</h2>
                    <form onSubmit={handleSubmit}>
                        <div className="input-group">
                            <label htmlFor="email-login">Email</label>
                            <input
                                type="email"
                                id="email-login"
                                name="email"
                                value={formData.email}
                                onChange={handleInputChange}
                                required
                                placeholder="Entrez votre email"
                            />
                        </div>
                        <div className="input-group">
                            <label htmlFor="password-login">Mot de passe</label>
                            <input
                                type="password"
                                id="password-login"
                                name="password"
                                value={formData.password}
                                onChange={handleInputChange}
                                required
                                placeholder="Entrez votre mot de passe"
                            />
                        </div>
                        <button type="submit" className="submit-btn">Se connecter</button>
                        <p>
                            Pas encore de compte ?{' '}
                            <span
                                className="switch-form"
                                onClick={() => setIsLogin(false)}
                            >
                                Inscrivez-vous
                            </span>
                        </p>
                    </form>
                </div>
            ) : (
                <div className="form-container register-form">
                    <h2>Inscription</h2>
                    <form onSubmit={handleSubmit}>
                        <div className="input-group">
                            <label htmlFor="first-name-register">Nom</label>
                            <input
                                type="text"
                                id="first-name-register"
                                name="firstName"
                                value={formData.firstName}
                                onChange={handleInputChange}
                                required
                                placeholder="Entrez votre nom"
                            />
                        </div>
                        <div className="input-group">
                            <label htmlFor="last-name-register">Prénom</label>
                            <input
                                type="text"
                                id="last-name-register"
                                name="lastName"
                                value={formData.lastName}
                                onChange={handleInputChange}
                                required
                                placeholder="Entrez votre prénom"
                            />
                        </div>
                        <div className="input-group">
                            <label htmlFor="age-register">Âge</label>
                            <input
                                type="number"
                                id="age-register"
                                name="age"
                                value={formData.age}
                                onChange={handleInputChange}
                                required
                                placeholder="Entrez votre âge"
                                min="18"
                            />
                        </div>
                        <div className="input-group">
                            <label htmlFor="email-register">Email</label>
                            <input
                                type="email"
                                id="email-register"
                                name="email"
                                value={formData.email}
                                onChange={handleInputChange}
                                required
                                placeholder="Entrez votre email"
                            />
                        </div>
                        <div className="input-group">
                            <label htmlFor="password-register">Mot de passe</label>
                            <input
                                type="password"
                                id="password-register"
                                name="password"
                                value={formData.password}
                                onChange={handleInputChange}
                                required
                                placeholder="Créez un mot de passe"
                            />
                        </div>
                        <button type="submit" className="submit-btn">S'inscrire</button>
                        <p>
                            Vous avez déjà un compte ?{' '}
                            <span
                                className="switch-form"
                                onClick={() => setIsLogin(true)}
                            >
                                Connectez-vous
                            </span>
                        </p>
                    </form>
                </div>
            )}
        </div>
    );
};

export default AuthForm;
